const dogNames =
  "코코 보리 콩이 초코 두부 호두 별이 사랑이 까미 몽이 토리 마루 구름 뭉치 해피 꼬미 망고 똘이 봄 쿠키 사랑이 콩이 둥이 모찌 만두 봄이 초롱이 레오 뚱이 루이 토토 구름이 가을이 송이 모모 땅콩 루비 짱아 흰둥이 뽀미 미미 장군이 아롱이 두리 여름이 밍키";

const catNames =
  "코코 보리 모모 까미 하루 미미 모찌 나비 치즈 두부 구름이 누누 라떼 초코 까망이 천둥 번개 써니 기쁨이 해피 구찌 샤넬 미키 루피 몰랑 토리 헨리 조이";

const names = [dogNames, catNames];

export default names;
